map(include('dag'))
---
dag:
  dag_id: str(regex('^[a-zA-Z0-9\\-\\._]+$'))
  description: str(required=False)
  doc_md: str(required=False)
  tags: list(str(), required=False)
  default_args: map(key=enum("owner", "email", "retries", "retry_delay", "priority_weight", "end_date", "wait_for_downstream", "execution_timeout", "trigger_rule", "start_date", "depends_on_past", "email_on_failure", "email_on_retry"), required=False, none=True)
  params: map(str(), str(), required=False, none=True)
  dagrun_timeout: int(required=False)
  fail_stop: bool(required=False)
  user_defined_macros: map(any(), any(), required=False, none=True)
  tasks: map(include('task', none=True), required=False)
  schedule_interval: str(required=False)
  schedule: str(required=False)
  python_version: any(required=False)
  is_paused_upon_creation: bool(required=False)
  start_date: any(required=False)
  end_date: any(required=False)
  catchup: bool(required=False)
  max_active_tasks: int(required=False)
  max_active_runs : int(required=False)
  max_consecutive_failed_dag_runs: int(required=False)
  template_searchpath: list(str(), required=False)
  template_undefined: any(required=False)
  render_template_as_native_obj: bool(required=False)
  user_defined_macros: any(required=False)
  user_defined_filters: any(required=False)
  dagrun_timeout: int(required=False)
  has_serialized_dag: bool(required=False)
  one_success_callback: any(required=False)
  one_failure_callback: any(required=False)
  access_control: any(required=False)
  auto_register: bool(required=False)
  fail_fast: bool(required=False)
  dag_display_name: str(required=False)
  jinja_environment_kwargs: any(required=False)
  owner_links: any(required=False)
  auto_register: bool(required=False)
  email_on_failure: bool(required=False)
  email_on_retry: bool(required=False)
  depends_on_past: bool(required=False)
---
task:
  task_id: str(required=False)
  retries: int(required=False)
  retry_delay: str(required=False)
  retry_exponential_backoff: bool(required=False)
  max_retry_delay: str(required=False)
  wait_for_downstream: bool(required=False)
  priority_weight: int(required=False)
  weight_rule: enum("absolute", "downstream", "upstream", required=False)
  execution_timeout: int(required=False)
  trigger_rule: enum("all_success", "all_failed", "all_done", "one_success", "one_failed", "none_failed", "none_failed_or_skipped", "none_skipped", "dummy", required=False)
  end_date: any(required=False)
  start_date: any(required=False)
  resources: map(str(), str(), required=False, none=True)
  params: map(str(), str(), required=False, none=True)
  fail_stop: bool(required=False)
  outlets: list(str(), required=False)
  deferrable-operators: bool(required=False)
  python_callable: str(required=False)
  python_callable_file: str(required=False)
  python_callable_name: str(required=False)
  external_dag_id: str(required=False)
  external_task_id: str(required=False)
  bash_command: str(required=False)
  input_config: any(required=False)
  output_config: any(required=False)
  wait_for_completion: bool(required=False)
  poll_interval: int(required=False)
  bucket: str(required=False)
  job_name: str(required=False)
  script_location: str(required=False)
  s3_bucket: str(required=False)
  iam_role_name: str(required=False)
  region_name: str(required=False)
